import asyncio
from duck_chat import DuckChat

async def get_answer(text):
    try:
        async with DuckChat() as chat:
            response = await chat.ask_question(f"Сколько символов в тексте: {text}\nВключая тект самого запроса")
            print(response)
            return response
    except Exception as e:
        error = f"Произошла ошибка при обработке ИИ: {e}"
        print(error)
        return None
    

asyncio.run(get_answer(""))
